import React from 'react';
import { Carousel } from 'react-bootstrap';
import ProductItem from '..ProductItem/ProductItem';

const JumbotronCarousel = ({ items }) => {
  return (
    <Carousel>
      {items.map((item) => (
        <Carousel.Item key={item._id}>
          <ProductItem {...item} />
        </Carousel.Item>
      ))}
    </Carousel>
  );
};

export default JumbotronCarousel;
